// /frontend/src/App.js

import React from 'react';

// This is a simplified version of our App component for debugging.
function App() {
  return (
    <div className="p-8">
      <h1 className="text-2xl font-bold">
        If you can see this, React is working!
      </h1>
    </div>
  );
}

// We export the App component so it can be used by other files (like index.js).
export default App;
